import './gradientborderbutton.css';

const gradientborderbutton = ({onClick, name, logo, classname}) => {
  return (
    <>
        <button className="listItem">
          <div className="buttonContent" style={{background: "#070707"}}>
            <span className="listText">Learn more</span>
          </div>
        </button>
    </>
  )
}

export default gradientborderbutton
